import React from 'react'
import './App.css';
import Main from './Main'
import Home from './Home'
import {BrowserRouter,Routes,Route} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
    <Routes>

      <Route path='/Main' element={<Main/>}></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
